import{_ as r,a,b as o,c as i,d as l,e as d,f as s,g as n,h as p,i as c,j as h,k as m,l as u,m as f,n as g,o as b,p as _,q as C,r as w,s as k,t as y}from"./chunks/qgc_airframe_generic_quadx.CbkbXFf6.js";import{_ as v,c as A,a8 as P,j as t,a as S,o as T}from"./chunks/framework.BDnHobkS.js";const M=JSON.parse('{"title":"DJI FlameWheel 450 + CUAV V5+ Build","description":"","frontmatter":{},"headers":[],"relativePath":"zh/frames_multicopter/dji_f450_cuav_5plus.md","filePath":"zh/frames_multicopter/dji_f450_cuav_5plus.md"}'),V={name:"zh/frames_multicopter/dji_f450_cuav_5plus.md"};function x(F,e,I,D,q,E){return T(),A("div",null,e[0]||(e[0]=[P('<h1 id="dji-flamewheel-450-cuav-v5-build" tabindex="-1">DJI FlameWheel 450 + CUAV V5+ Build <a class="header-anchor" href="#dji-flamewheel-450-cuav-v5-build" aria-label="Permalink to &quot;DJI FlameWheel 450 + CUAV V5+ Build&quot;">​</a></h1><p>This topic provides full instructions for building the kit and configuring PX4 using <em>QGroundControl</em>.</p><p>Key information</p><ul><li><strong>Frame:</strong> DJI F450</li><li><strong>Flight controller:</strong> <a href="./../flight_controller/cuav_v5_plus.html">CUAV V5+</a></li><li><strong>Assembly time (approx.):</strong> 90 minutes (45 minutes for frame, 45 minutes autopilot installation/configuration)</li></ul><p><img src="'+r+'" alt="Finished setup 1"></p><h2 id="bill-of-materials" tabindex="-1">Bill of materials <a class="header-anchor" href="#bill-of-materials" aria-label="Permalink to &quot;Bill of materials&quot;">​</a></h2><p>The components needed for this build are:</p><ul><li>Flight controller: <a href="https://store.cuav.net/index.php?id_product=95&amp;id_product_attribute=0&amp;rewrite=cuav-new-pixhack-v5-autopilot-m8n-gps-for-fpv-rc-drone-quadcopter-helicopter-flight-simulator-free-shipping-whole-sale&amp;controller=product&amp;id_lang=1" target="_blank" rel="noreferrer">CUAV V5+</a>: <ul><li>GPS: <a href="https://store.cuav.net/index.php?id_product=97&amp;id_product_attribute=0&amp;rewrite=cuav-new-ublox-neo-m8n-gps-module-with-shell-stand-holder-for-flight-controller-gps-compass-for-pixhack-v5-plus-rc-parts-px4&amp;controller=product&amp;id_lang=1" target="_blank" rel="noreferrer">CUAV NEO V2 GPS</a></li><li>Power Module</li></ul></li><li>Frame: <a href="https://www.amazon.com/Flame-Wheel-Basic-Quadcopter-Drone/dp/B00HNMVQHY" target="_blank" rel="noreferrer">DJI F450</a></li><li>Propellers: <a href="https://www.masterairscrew.com/products/dji-phantom-built-in-nut-upgrade-propellers-in-black-mr-9-4x5-prop-set-x4-phantom" target="_blank" rel="noreferrer">DJI Phantom Built-in Nut Upgrade Propellers 9.4x5</a></li><li>Battery: <a href="https://hobbyking.com/en_us/turnigy-high-capacity-5200mah-3s-12c-multi-rotor-lipo-pack-w-xt60.html?___store=en_us" target="_blank" rel="noreferrer">Turnigy High Capacity 5200mAh 3S 12C Lipo Pack w/XT60</a></li><li>Telemetry: <a href="./../telemetry/holybro_sik_radio.html">Holybro Transceiver Telemetry Radio V3</a></li><li>RC Receiver: <a href="https://www.banggood.com/FrSky-D4R-II-2_4G-4CH-ACCST-Telemetry-Receiver-for-RC-Drone-FPV-Racing-p-929069.html?cur_warehouse=GWTR" target="_blank" rel="noreferrer">FrSky D4R-II 2.4G 4CH ACCST Telemetry Receiver</a></li><li>Motors: <a href="https://www.amazon.com/DJI-E305-2312E-Motor-960kv/dp/B072MBMCZN" target="_blank" rel="noreferrer">DJI E305 2312E Motor (960kv,CW)</a></li><li>ESC: Hobbywing XRotor 20A APAC Brushless ESC 3-4S For RC Multicopters</li></ul><p>In addition, we used an FrSky Taranis controller. You will also need zip ties, double-sided tape, a soldering iron.</p><p>The image below shows both frame and electronic components.</p><p><img src="'+a+'" alt="All components used in this build"></p><h2 id="硬件" tabindex="-1">硬件 <a class="header-anchor" href="#硬件" aria-label="Permalink to &quot;硬件&quot;">​</a></h2><h3 id="框架" tabindex="-1">框架 <a class="header-anchor" href="#框架" aria-label="Permalink to &quot;框架&quot;">​</a></h3><p>This section lists all hardware for the frame.</p><table tabindex="0"><thead><tr><th>描述</th><th>Quantity</th></tr></thead><tbody><tr><td>DJI F450 Bottom plate</td><td>1</td></tr><tr><td>DJI F450 Top plate</td><td>1</td></tr><tr><td>DJI F450 legs with landing gear</td><td>4</td></tr><tr><td>M3*8 screws</td><td>18</td></tr><tr><td>M2 5*6 screws</td><td>24</td></tr><tr><td>Velcro Battery Strap</td><td>1</td></tr><tr><td>DJI Phantom Built-in Nut Upgrade Propellers 9.4x5</td><td>1</td></tr></tbody></table><p><img src="'+o+'" alt="F450 frame components"></p><h3 id="cuav-v5-package" tabindex="-1">CUAV V5+ Package <a class="header-anchor" href="#cuav-v5-package" aria-label="Permalink to &quot;CUAV V5+ Package&quot;">​</a></h3><p>This section lists the components in the CUAV v5+ package.</p><table tabindex="0"><thead><tr><th>描述</th><th>Quantity (Default Package)</th><th>Quantity (+GPS Package)</th></tr></thead><tbody><tr><td>V5+ Autopilot</td><td>1</td><td>1</td></tr><tr><td>DuPont Cable</td><td>2</td><td>2</td></tr><tr><td>I2C/CAN Cable</td><td>2</td><td>2</td></tr><tr><td>ADC 6.6 Cable</td><td>2</td><td>2</td></tr><tr><td>SBUS Signal Cable</td><td>1</td><td>1</td></tr><tr><td>IRSSI Cable</td><td>1</td><td>1</td></tr><tr><td>DSM Signal Cable</td><td>1</td><td>1</td></tr><tr><td>ADC 3.3 Cable</td><td>1</td><td>1</td></tr><tr><td>Debug Cable</td><td>1</td><td>1</td></tr><tr><td>Safety Switch Cable</td><td>1</td><td>1</td></tr><tr><td>Voltage &amp; Current Cable</td><td>1</td><td>1</td></tr><tr><td>PW-Link Module Cable</td><td>1</td><td>1</td></tr><tr><td>Power Module</td><td>1</td><td>1</td></tr><tr><td>SanDisk 16GB Memory Card</td><td>1</td><td>1</td></tr><tr><td>12C Expansion Board</td><td>1</td><td>1</td></tr><tr><td>TTL Plate</td><td>1</td><td>1</td></tr><tr><td>NEO GPS</td><td>-</td><td>1</td></tr><tr><td>GPS Bracket</td><td>-</td><td>1</td></tr></tbody></table><p><img src="'+i+'" alt="CUAV V5+ components"></p><h3 id="electronics" tabindex="-1">Electronics <a class="header-anchor" href="#electronics" aria-label="Permalink to &quot;Electronics&quot;">​</a></h3><table tabindex="0"><thead><tr><th>描述</th><th>Quantity</th></tr></thead><tbody><tr><td>CUAV V5+</td><td>1</td></tr><tr><td>CUAV NEO V2 GPS</td><td>1</td></tr><tr><td>Holibro Telemetry</td><td>1</td></tr><tr><td>FrSky D4R-II 2.4G 4CH ACCST Telemetry Receiver</td><td>1</td></tr><tr><td>DJI E305 2312E Motor (800kv,CW)</td><td>4</td></tr><tr><td>Hobbywing XRotor 20A APAC Brushless ESC</td><td>4</td></tr><tr><td>Power Module(Included in the CUAV V5+ package)</td><td>1</td></tr><tr><td>Turnigy High Capacity 5200mAh 3S 12C Lipo Pack w/XT60</td><td>1</td></tr></tbody></table><h3 id="tools-needed" tabindex="-1">Tools needed <a class="header-anchor" href="#tools-needed" aria-label="Permalink to &quot;Tools needed&quot;">​</a></h3><p>The following tools are used in this assembly:</p><ul><li>2.0mm Hex screwdriver</li><li>3mm Phillips screwdriver</li><li>Wire cutters</li><li>Precision tweezers</li><li>Soldering iron</li></ul><p><img src="'+l+'" alt="Required tools"></p><h2 id="组装" tabindex="-1">组装 <a class="header-anchor" href="#组装" aria-label="Permalink to &quot;组装&quot;">​</a></h2><p>Estimated time to assemble is approximately 90 minutes (about 45 minutes for the frame and 45 minutes installing the autopilot and configuring the airframe.</p><ol><li><p>Attach the 4 arms to the bottom plate using the provided screws.</p><p><img src="'+d+'" alt="Arms to bottom plate"></p></li><li><p>Solder ESC (Electronic Speed Controller) to the board, positive (red) and negative (black).</p><p><img src="'+s+'" alt="Solder ESCs"></p></li><li><p>Solder the Power Module, positive (red) and negative (black).</p><p><img src="'+n+'" alt="Solder power module"></p></li><li><p>Plug in the motors to the ESCs according to their positions.</p><p><img src="'+p+'" alt="Plug in motors"></p></li><li><p>Attach the motors to the corresponding arms.</p><p><img src="'+c+'" alt="Attach motors to arms (white)"><img src="'+h+'" alt="Attach motors to arms (red)"></p></li><li><p>Add the top board (screw into the top of the legs).</p><p><img src="'+m+'" alt="Add top board"></p></li><li><p>Add double-sided tape (3M) to the CUAV V5+ flight controller (it has internal vibration damping, so no need to use foam).</p><p><img src="'+u+'" alt="Tape CUAV v5+"></p></li><li><p>Attach the FrSky receiver to the bottom board with double-sided tape.</p><p><img src="'+f+'" alt="Attach FrSky receiver with double-sided tape"></p></li><li><p>Attach the telemetry module to the vehicle’s bottom board using double-sided tape.</p><p><img src="'+g+'" alt="Attach telemetry radio"><img src="'+b+'" alt="Attach telemetry radio"></p></li><li><p>Put the aluminium standoffs on the button plate.</p></li><li><p>Plug in Telemetry (<code>TELEM1</code>) and GPS module (<code>GPS/SAFETY</code>) to the flight controller. <img src="'+_+'" alt="Attach GPS"><img src="'+C+'" alt="Attach GPS"></p></li><li><p>Plug in the RC receiver (<code>RC</code>), all 4 ESC’s (<code>M1-M4</code>), and the power module (<code>Power1</code>) into the flight controller. <img src="'+w+'" alt="Attach peripherals to flight controller"></p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>The motor order is defined in the <a href="./../airframes/airframe_reference.html#quadrotor-x">Airframe Reference &gt; Quadrotor x</a></p></div></li></ol><p>:::</p><p>设置完成！ The final build is shown below:</p><p><img src="'+k+'" alt="Finished Setup"></p><h2 id="px4-配置" tabindex="-1">PX4 配置 <a class="header-anchor" href="#px4-配置" aria-label="Permalink to &quot;PX4 配置&quot;">​</a></h2><p><em>QGroundControl</em> is used to install the PX4 autopilot and configure/tune it for the frame. <a href="http://qgroundcontrol.com/downloads/" target="_blank" rel="noreferrer">Download and install</a><em>QGroundControl</em> for your platform.</p><div class="tip custom-block"><p class="custom-block-title">TIP</p><p>Full instructions for installing and configuring PX4 can be found in <a href="./../config/">Basic Configuration</a>.</p></div><p>First update the firmware, airframe, geometry, and outputs:</p><ul><li><p><a href="./../config/firmware.html">Firmware</a></p></li><li><p><a href="./../config/airframe.html">Airframe</a></p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>You will need to select the <em>Generic Quadcopter</em> airframe (<strong>Quadrotor x &gt; Generic Quadcopter</strong>).</p><p><img src="'+y+'" alt="QGroundControl - Select Generic Quadcopter"></p></div></li></ul><p>:::</p><ul><li><a href="./../config/actuators.html">Actuators</a><ul><li>Update the vehicle geometry to match the frame.</li><li>Assign actuator functions to outputs to match your wiring.</li><li>Test the configuration using the sliders.</li></ul></li></ul><p>Then perform the mandatory setup/calibration:</p><ul><li><p><a href="./../config/flight_controller_orientation.html">Sensor Orientation</a></p></li><li><p><a href="./../config/compass.html">Compass</a></p></li><li><p><a href="./../config/accelerometer.html">Accelerometer</a></p></li><li><p><a href="./../config/level_horizon_calibration.html">Level Horizon Calibration</a></p></li><li><p><a href="./../config/radio.html">Radio Setup</a></p></li><li><p><a href="./../config/flight_mode.html">Flight Modes</a></p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>For this build we set up modes <em>Stabilized</em>, <em>Altitude</em> and <em>Position</em> on a three-way switch on the receiver (mapped to a single channel - 5). This is the recommended minimal set of modes for beginners.</p></div></li></ul><p>:::</p><p>Ideally you should also do:</p><ul><li><a href="./../advanced_config/esc_calibration.html">ESC Calibration</a></li><li><a href="./../config/battery.html">Battery Estimation Tuning</a></li><li><a href="./../config/safety.html">Safety</a></li></ul><h2 id="调试" tabindex="-1">调试 <a class="header-anchor" href="#调试" aria-label="Permalink to &quot;调试&quot;">​</a></h2><p>Airframe selection sets <em>default</em> autopilot parameters for the frame. These may be good enough to fly with, but you should tune each frame build.</p><p>For instructions on how, start from <a href="./../config/autotune_mc.html">Autotune</a>.</p><h2 id="视频" tabindex="-1">视频 <a class="header-anchor" href="#视频" aria-label="Permalink to &quot;视频&quot;">​</a></h2>',48),t("lite-youtube",{videoid:"r-IkaVpN1Ko",title:"CUAV V5+"},null,-1),t("h2",{id:"acknowledgments",tabindex:"-1"},[S("Acknowledgments "),t("a",{class:"header-anchor",href:"#acknowledgments","aria-label":'Permalink to "Acknowledgments"'},"​")],-1),t("p",null,"This build log was provided by the Dronecode Test Flight Team.",-1)]))}const R=v(V,[["render",x]]);export{M as __pageData,R as default};
